/*Qual a maior e a menor nota na disciplina de Cálculo Numérico no 1º semestre de 1998.
*/
select max(nota), min(nota)
from disciplina d, aula au
where d.nome = 'CALCULO NUMERICO' and au.semestre = '01/1998' 
/*10.00	3.50*/

/* Qual o nome do aluno que obteve maior nota na disciplina de Engenharia de Software no 1º
semestre de 1998. Deve retornar o nome e a nota do aluno.*/

select al.nome, au.nota
from aluno al, disciplina d, aula au
where nota = (select max(nota) from aula) and d.nome = 'ENGENHARIA DE SOFTWARE' 
and au.semestre = '01/1998'

