/* Quais os alunos que tiveram nota entre 5.0 e 7.0 em ordem alfabetica de disciplina. Deve
retornar o nome do aluno, o nome da disciplina e nota referente a disciplina.*/

select al.nome, d.nome, au.nota
from  aluno al, disciplina d, aula au
where au.nota between 5 and 7 and au.NumDisp = d.NumDisp and al.NumAluno = au.NumAluno
order by d.nome
