/*Qual foi a quantidade de créditos concluídos (considerar somente as disciplinas aprovadas)
do aluno Edvaldo Carlos Silva.*/
select count(d.QuantCreditos)
from  aluno al, disciplina d, aula au
where al.nome = 'EDVALDO CARLOS SILVA' and au.nota >= 6
/*119*/

/*Quais os nomes de alunos que já completaram 70 créditos (considerar somente os aprovados
na disciplina). Deve retornar os nomes dos alunos e a quantidade de créditos.*/

select count(d.QuantCreditos)
from aluno al, disciplina d, aula au 
where  d.QuantCreditos = 70 and au.nota >= 6
group by al.nome

/*Quais os nomes de alunos que cursaram o 1º semestre de 1998, pertencem ao curso de Ciência
da Computação e possuem nota superior à 8.0. Deve retornar os nomes dos alunos, os nomes
da disciplina e os nomes dos professores.*/

